import './App.css';
import Cell from './components/Cell'

function App() {
  const matrixObject = []

  for (let i = 0; i < 8; i++) {
    matrixObject.push([])
    for (let k = 0; k < 8; k++) {
      matrixObject[i].push(k)
    }
  }

  console.log(matrixObject)
  let mapArr = matrixObject.map(el => el)
  console.log(mapArr)

  return (
    <div className="App">
      <header className="App-header">
        {matrixObject.map((e) =>

          <Cell
            Cell={e}
          />
        )
        }

      </header >
    </div >
  );
}

export default App;
